export enum TaskType {
    HEADS = 'HEADS',
    TAILS = 'TAILS'
}

export enum TaskStatus {
    PENDING = 'PENDING',
    IN_PROGRESS = 'IN_PROGRESS',
    COMPLETED = 'COMPLETED'
}

export interface Task {
    id: string;
    type: TaskType;
    status: TaskStatus;
    batch_id: number;
}

export interface Player {
    id: string;
    name: string;
    status: PlayerStatus;
    tasks: string[];
}

export enum PlayerStatus {
    ACTIVE = 'ACTIVE',
    WAITING = 'WAITING',
    IDLE = 'IDLE'
}
